import { BrowserRouter as Router, Route } from "react-router-dom";
import React from "react";
import DateStepComponent from "../../date-step/components";
import ItemSelectStepComponent from '../../car-step/components';
import ExtrasStepComponent from '../../extras-step/components';
import ConfirmationComponent from '../../confirmation-step/components';
import PropTypes from "prop-types";
import { connect } from "react-redux";


function ReservationStepsContainer({ currentStep }) {
  debugger;
  return (
    <React.Fragment>
      <div className="reservation-step-container">
        <h3>{currentStep.header}</h3>
        {getCurrentStep(currentStep.value)}
      </div>
    </React.Fragment>

  );
}

const getCurrentStep = currentStepIndex => {
  switch (currentStepIndex) {
    case 0:
      return <DateStepComponent />;
    case 1:
      return <ItemSelectStepComponent />;
    case 2:
      return <ExtrasStepComponent />;
    case 3:
      return <ConfirmationComponent />
  }
};

const mapStateToProps = ({ reservationApp }) => ({
  currentStep: reservationApp.currentStep
});

ReservationStepsContainer.propTypes = {
  reservationStep: PropTypes.shape({ value: PropTypes.number })
};

export default connect(mapStateToProps)(ReservationStepsContainer);
